// src/components/CertificateDetail.js
import React, { useState, useEffect } from "react";
import { useParams, Link } from "react-router-dom";
import API from "../api";

export default function CertificateDetail({ data: propData }) {
  // Recebe via propData (inline) ou da rota (/certificates/:id)
  const { id: routeId } = useParams();
  const certId = propData?.certification_id ?? routeId;

  const [cert, setCert] = useState(propData || null);
  const [err, setErr] = useState(false);

  useEffect(() => {
    // Se já veio propData, não faz fetch
    if (propData) return;

    API.get(`/search/certification/${certId}`)
      .then((r) => setCert(r.data))
      .catch(() => setErr(true));
  }, [certId, propData]);

  if (err) return <p>Certificação não encontrada.</p>;
  if (!cert) return <p>Carregando...</p>;

  return (
    <div className="card" style={{ padding: 16, marginTop: 16 }}>
      <h2>Detalhes da Certificação</h2>

      {/* DEBUG: exibe o JSON completo para inspeção */}
      <pre
        style={{
          background: "#f5f5f5",
          padding: 8,
          maxHeight: 200,
          overflow: "auto",
        }}
      >
        {JSON.stringify(cert, null, 2)}
      </pre>

      <p>
        <strong>ID:</strong> {cert.certification_id}
      </p>
      <p>
        <strong>Denominação:</strong> {cert.denominacao}
      </p>
      <p>
        <strong>Proprietário(a):</strong> {cert.proprietario}
      </p>
      <p>
        <strong>Matrícula:</strong> {cert.matricula_imovel}
      </p>
      <p>
        <strong>Natureza:</strong> {cert.natureza_area}
      </p>
      <p>
        <strong>CNPJ:</strong> {cert.cnpj}
      </p>
      <p>
        <strong>Município/UF:</strong> {cert.municipio_uf}
      </p>
      <p>
        <strong>Código INCRA/SNCR:</strong> {cert.codigo_incra}
      </p>
      <p>
        <strong>Responsável Técnico:</strong> {cert.responsavel_tecnico}
      </p>
      <p>
        <strong>Formação:</strong> {cert.formacao}
      </p>
      <p>
        <strong>Cód. credenciamento:</strong> {cert.codigo_credenciamento}
      </p>
      <p>
        <strong>Sis. Geodésico ref.:</strong> {cert.sistema_geodesico}
      </p>
      <p>
        <strong>Doc. RT:</strong> {cert.documento_rt}
      </p>
      <p>
        <strong>Área (local):</strong> {cert.area_local}
      </p>
      <p>
        <strong>Perímetro:</strong> {cert.perimetro}
      </p>
      <p>
        <strong>Azimutes:</strong> {cert.azimutes}
      </p>
      <p>
        <strong>Data Certif.:</strong> {cert.data_certificacao}
      </p>
      <p>
        <strong>Data Geração:</strong> {cert.data_geracao}
      </p>

      {/* botão “voltar” só em modo rota */}
      {!propData && (
        <Link to="/certificates">
          <button style={{ marginTop: 16 }}>Voltar à lista</button>
        </Link>
      )}
    </div>
  );
}
